// Input: { segment, page?, per_page?, force_verified? }
// Output: { apolloBody }
const i = items[0].json || {};
const seg = String(i.segment || "").toLowerCase();

const common = (overrides = {}) => ({
  sort_by_field: "recommendations_score",
  sort_ascending: false,
  page: Number.isInteger(i.page) ? i.page : 1,
  per_page: Number.isInteger(i.per_page) ? i.per_page : 50,
  ...(i.force_verified ? { email_status: "verified" } : { email_status: "verified" }),
  ...overrides,
});

let body;
switch (seg) {
  case "manufacturers": // 100–1,000; US/UK/DE/NL/CN/IN; exporting into Africa
    body = common({
      person_seniorities: ["cxo","vp","head","director","manager"],
      person_titles: [
        "CFO","Chief Financial Officer","VP Finance","Finance Director",
        "Head of Treasury","Treasury Manager",
        "Procurement Manager","Head of Procurement","Supply Chain Head",
        "Accounts Payable Manager","AP Manager"
      ],
      locations: ["United States","United Kingdom","Germany","Netherlands","China","India"],
      organization_locations: ["Nigeria","Ghana","Kenya","South Africa","Algeria"],
      person_industry_tags: ["Manufacturing","Industrial Goods","FMCG","Agriculture"],
      organization_num_employees_ranges: ["100-200","201-500","501-1000"]
    });
    break;

  case "ecommerce": // 20–400; NG/GH/KE/ZA + UK/EU/US; D2C/Marketplaces
    body = common({
      person_seniorities: ["owner","founder","cxo","head","director","manager"],
      person_titles: [
        "CEO","Founder","Co-Founder",
        "Head of E-commerce","E-commerce Manager",
        "Operations Manager","Finance Manager","Payment Operations Lead"
      ],
      locations: ["Nigeria","Ghana","Kenya","South Africa","United Kingdom","European Union","United States","Canada"],
      person_industry_tags: ["E-commerce","Retail","D2C","Marketplaces"],
      organization_num_employees_ranges: ["20-50","51-100","101-200","201-400"]
    });
    break;

  case "traders": // importers/exporters 50–400; NG/GH/KE/ZA/DZ
    body = common({
      person_seniorities: ["cxo","vp","head","director","manager"],
      person_titles: [
        "COO","Chief Operating Officer",
        "Head of International Trade","Trade Finance Manager",
        "Logistics Manager","Operations Director"
      ],
      locations: ["Nigeria","Ghana","Kenya","South Africa","Algeria"],
      person_industry_tags: ["Import/Export","Logistics","Wholesale","Distribution","International Trade"],
      organization_num_employees_ranges: ["50-100","101-200","201-400"]
    });
    break;

  case "fintech": // 20–500; Africa/EU/Asia/US; Payments/Wallets/Remittances/Crypto
    body = common({
      person_seniorities: ["owner","founder","cxo","vp","head","director"],
      person_titles: [
        "CEO","Founder","COO",
        "CTO","VP Engineering",
        "Head of Payments","Head of Treasury","API Integrations Lead"
      ],
      locations: ["Nigeria","Ghana","Kenya","South Africa","United Kingdom","European Union","United States","India","Singapore","United Arab Emirates"],
      person_industry_tags: ["Fintech","Payments","Digital Wallets","Remittances","Crypto","Web3"],
      organization_num_employees_ranges: ["20-50","51-100","101-200","201-500"]
    });
    break;

  case "ngo": // 50–300; NGOs/Consultancies; Africa ops + US/EU HQ
    body = common({
      person_seniorities: ["cxo","head","director","manager"],
      person_titles: ["Finance Director","Treasury Manager","Grants Manager","CFO","Program Director","Program Manager"],
      locations: ["United States","United Kingdom","European Union","Nigeria","Ghana","Kenya","South Africa","Algeria"],
      person_industry_tags: ["NGO","Nonprofit","Consulting","Professional Services","International Development"],
      organization_num_employees_ranges: ["50-100","101-200","201-300"]
    });
    break;

  default:
    return [{ json: { error: "Unknown segment", segment: seg } }];
}

return [{ json: { ...i, apolloBody: body } }];

// n8n Code node (JavaScript)
const batch = $items().map(item => {
  return { id: item.json.id };
});

return [{
  json: {
    details: batch
  }
}];

// Collect all domains from incoming items
const domains = $items().map(item => item.json.organization.primary_domain);

// Return a single item with domains array
return [
  {
    json: {
      domains
    }
  }
];

